import React from 'react';
import './header.scss'
import logo_head from "./logo_usd.jpg";
import logo_vk from "./logo_vk.jpg";
import Link from "./link";
const Header = () => {
    return (
        <header className='header'>
            <div className="first_header">
                <div className="logo_header">
                    <img src={logo_head}/>
                </div>
                <div className="link_header">
                    <Link {...(asd)}/>
                    <div className="link_text">Календарь</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Результаты</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Рекорды</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Фото-Видео</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Партнеры</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Правила</div>
                    <div className="text-white text-base font-normal font-['Roboto']">Прямой эфир</div>
                </div>
            </div>
            <div className="second_header">
                <div className="vk_logo">
                    <img src={logo_vk}/>
                </div>
                <div className="link_text">Личный кабинет</div>
            </div>

        </header>
    );
};

export default Header;
